import { useSelector } from "react-redux";
import ProductsItem from "../components/Products/ProductItem/ProductItem";

const ProductsPage = () => {
  const products = useSelector((state) => state.products.products);
  return (
    <>
      {products.map((product) => (
        <ProductsItem
          key={product.id}
          title={product.title}
          price={product.price}
          totalPrice={product.totalPrice}
          id={product.id}
        />
      ))}
    </>
  );
};

export default ProductsPage;
